import "./App.css";
import { Safety } from "./components/safety.js";
import { Inspect } from "./components/inspect.js";
import { Contact } from "./components/contact.js";

import React, { useState } from "react";

function App() {
  const [currentPage, setCurrentPage] = useState("inspect");

  return (
    <div>
      <div className="App">
        {currentPage === "inspect" && <Inspect />}
        {currentPage === "safety" && <Safety />}
        {currentPage === "contact" && <Contact />}
      </div>
      <nav>
        <button onClick={() => setCurrentPage("inspect")}>Inspect</button>
        <button onClick={() => setCurrentPage("safety")}>Safety</button>
        <button onClick={() => setCurrentPage("contact")}>Contact</button>
      </nav>
    </div>
  );
}

export default App;
